import React from 'react'
import './Clock.sass'

function Clock() {
    let date = new Date;
    return (
        <div className='clock'>
            <div className='clock-time'>
                <p className='clock-time-hours'>{date.getHours()}</p>
                <p className='clock-time-minutes'>{date.getMinutes()}</p>
            </div>
            <p className='clock-day'>{date.getDay()}</p>
        </div>
    )
}

export default Clock
